  parser.yy.selectListAliasesStack.push(parser.yy.selectListAliases);
  parser.yy.primariesStack.push(parser.yy.latestTablePrimaries);
  parser.yy.subQueriesStack.push(parser.yy.subQueries);

  parser.yy.result = {};
  parser.yy.locations = [];
